import React from 'react';

export default function Header()
{
    const [logOut,setLogOut] = React.useState(true);
    return(
        <header className="header">
        <h1 className="header-title">Kite</h1>
        {logOut ? <button>Logout</button> : <div></div>}
        <img src="https://png.pngtree.com/element_our/md/20180517/md_5afd2b1f0ced7.jpg" alt="" className="header-img"/>
        </header>
    )
}
